import React from 'react';
import {Switch, Route} from "react-router-dom";
import Home from '../Views/Home';

 class AppRouter extends React.Component {
    render() {
      return (
        <>
            <Switch>
                <Route exact path="/" component={Home}/>
            </Switch>
        </>
      )
    }
  }

  export default AppRouter
